<!DOCTYPE html><html lang="en"><head><style>
:root {
    --main-bg-color: #68B8F9;
    --main-font-color: black;
    --secondary-bg-color: #a4d4fb;
    --main-bottom: -20%;
    --main-right: 2%;
    --main-opacity: 1;
    --main-border-radius: 5px;
    --main-box-shadow: rgba(0, 0, 0, 0.35) 0 5px 15px;
    --main-position: fixed;
    --main-width: 500px;
    --main-height: 100px;
    --main-transition-property: top;
    --main-transition-delay: 500ms;
}

#container {
    position: absolute;
    top: 40px;
    left: 0;
    overflow: auto;
    margin-left: 10px;
}

#burger {
    display: flex;
    width: 10px;
    height: 10px;
    justify-content: space-around;
}

#burger div {
    background-color: white;
    transition: width .2s, height .2s;
}

#burger.horizontal {
    flex-direction: column;
}

#burger.vertical {
    flex-direction: row;
}

#burger.horizontal div {
    width: 10px;
    height: 2px;
}

#burger.vertical div {
    width: 2px;
    height: 10px;
}


html {
    scroll-behavior: smooth;
    scroll-padding-left: 30%;
    margin-top: 40px;
}

h3 {
    scroll-margin-top: 60px;
}

td {
    scroll-margin-top: 50px;
}

tr {
    scroll-margin-top: 50px;
}

a:hover {
    text-decoration: none;
}

#pageContent {
    position: fixed;
    background-color: white;
    box-shadow: rgba(0, 0, 0, 0.35) 0 5px 15px;
    top: 40px;
    left: 0;
    bottom: 0;
    width: 0;
    overflow: auto;
    display: flex;
    flex-direction: row;
    flex-wrap: nowrap;
}

#pageContent.hidden {
    width: 0;
}
#pageContent ul.active {
    display: block;
    font-family: Monospace, serif;
    width: fit-content;
    height: fit-content;
}

#pageContent ul.hidden {
    display: none;
}

#pageContent li.current {
    border: 2px solid black;
    border-radius: 3px;
}
#pageContent li.hidden {
    display: none;
}
#pageContent li.active {
    background-color: var(--secondary-bg-color);
    border-radius: 3px;
}

select {
    padding: 6px;
    margin-top: 8px;
    margin-left: 4px;
    border: 0;
}

#commonstat {
    display: flex;
    flex-wrap: wrap;
}

#commonstat div {
    margin-right: 10px;
}

table {
    margin-bottom: 10px;
}

table, th, td {
    border: 1px solid black;
    border-collapse: collapse;
    padding: 4px;
}

table tr td.table_obj_value, table tr td.mono {
    font-family: Monospace, serif;
}

table tr td.table_obj_value {
    text-align: right;
}

table tr td.fullScreen {
    width: 85%
}

table tr td.halfScreen {
    width: 42%;
}

table p {
    margin: 0.2em;
}

table tr.new td.switch_bold {
    font-weight: bold;
}

table th {
    color: black;
    background-color: #ffcc99;
}

table tr:target, td:target {
    border: medium solid limegreen;
}

table tr:target td:first-of-type, table td:target {
    font-weight: bold;
}

table tr.active td {
    background-color: #CCF1FF;
}

table tr.active td {
    background-color: #CCF1FF;
}

table tr.active td {
    background-color: #CCF1FF;
}

table tr.active td {
    background-color: #CCF1FF;
}

table tr.active td:not(.hdr) {
    background-color: #CCF1FF;
}

div.warning {
    display: inline-flex;
    padding: 10px;
    max-width: 300px;
    border: 1px solid black;
    border-radius: 5px;
    margin-bottom: 10px;
    background-color: pink;
    font-size: 12px;
    font-family: Monospace, serif;
}

div.notice {
    display: inline-flex;
    padding: 10px;
    max-width: 300px;
    border: 1px solid black;
    border-radius: 5px;
    margin-bottom: 10px;
    background-color: #CCF1FF;
    font-size: 12px;
    font-family: Monospace, serif;
}

div.popup {
    background-color: var(--main-bg-color);
    bottom: var(--main-bottom);
    color: var(--main-font-color);
    right: var(--main-right);
    opacity: var(--main-opacity);
    border-radius: var(--main-border-radius);
    position: var(--main-position);
    max-width: var(--main-width);
    transition: bottom 250ms linear;
    z-index: 500 !important;
    padding: 10px 20px;
}

svg rect:hover, svg circle:hover, svg path:hover, a.copyButton svg:hover > rect {
    stroke: limegreen;
    cursor: pointer;
    fill: #D9FFCC;
}

/* Add a black background color to the top navigation bar */
#topnav {
    position: fixed;
    top: 0;
    width: 100%;
    background-color: #e9e9e9;
    z-index: 999;
}

/* Style the links inside the navigation bar */
#topnav a {
    float: left;
    display: block;
    background-color: #2196F3;
    color: black;
    text-align: center;
    padding: 14px 16px;
    text-decoration: none;
    cursor: pointer;
    font-size: 14px;
    font-family: Monospace, serif;
}

/* Change the color of links on hover */
#topnav a:hover {
    background-color: #ddd;
}

/* Style the "active" element to highlight the current page */
#topnav a.active {
    color: white;
}

/* Style the search box inside the navigation bar */
#topnav input[type=search] {
    float: left;
    border: none;
    margin-top: 8px;
    margin-left: 200px;
    font-size: 14px;
    font-family: Monospace, serif;
    -webkit-appearance: searchfield-cancel-button;
}

/* When the screen is less than 600px wide, stack the links and the search field vertically instead of horizontally */
@media screen and (max-width: 600px) {
    #topnav a, #topnav input[type=search] {
        float: none;
        display: block;
        text-align: left;
        width: 100%;
        margin: 0;
        padding: 14px;
    }

    #topnav input[type=search] {
        border: 1px solid #ccc;
    }
}

/* ----------- Differential report styles ----------- */

td.int1, .int1 td:not(.hdr), table tr.new_i1 {
    background-color: #FFEEEE;
}

td.int2, .int2 td:not(.hdr), table tr.new_i2 {
    background-color: #EEEEFF;
}

table tr.int1:not(.active) td:not(.hdr) {
    background-color: #FFEEEE;
}

table tr.int2:not(.active) td:not(.hdr) {
    background-color: #EEEEFF;
}

table tr.int2 td {
    border-top: hidden;
}

table tr.queryRow {
    background-color: white;
}

table tr.grey {
    background-color: #eee;
}
table tr.queryRow {
    background-color: white;
}

table tr.queryRow p, table tr.queryRow a, table tr.planRow p, table tr.planRow a {
    display: inline-block;
}

table tr.queryRow p, table tr.planRow p {
    width: 95%;
}

table tr.queryRow a, table tr.planRow a {
    float: right;
}

table tr td.queryText {
    font-size: 13px;
}

table tr.new_i1 td.switch_bold, table tr.new_i2 td.switch_bold, .new td.switch_bold {
    font-weight: bold;
}

table th {
    color: black;
    background-color: #ffcc99;
}

.label {
    color: grey;
}

table tr:target, td:target {
    border: medium solid limegreen;
}

table tr:target td:first-of-type, table td:target {
    font-weight: bold;
}

table tr.parent td {
    background-color: #D8E8C2;
}

table tr.child td {
    background-color: #BBDD97;
    border-top-style: hidden;
}

table tr.active td {
    background-color: #CCF1FF;
}

7d4746fda43c676", "query_texts": ["SELECT dblink_connect($1,$2)"]}, {"hexqueryid": "d7f53f37356b96e2", "query_texts": ["select pg_catalog.version()"]}, {"hexqueryid": "d807bd385af82f74", "query_texts": ["INSERT INTO sample_stat_activity_cnt ( server_id, sample_id, subsample_ts, sess_attr_id, total, active, idle, idle_t, idle_ta, state_null, lwlock, lock, bufferpin, activity, extension, client, ipc, timeout, io ) SELECT sserver_id, s_id, l.subsample_ts, s.sess_attr_id, l.total, l.active, l.idle, l.idle_t, l.idle_ta, l.state_null, l.lwlock, l.lock, l.bufferpin, l.activity, l.extension, l.client, l.ipc, l.timeout, l.io FROM last_stat_activity_count l JOIN session_attr s ON (l.server_id, s.server_id, s.backend_type) = (sserver_id, sserver_id, l.backend_type) AND (s.datid, s.datname, s.usesysid, s.usename, s.application_name, s.client_addr) IS NOT DISTINCT FROM (l.datid, l.datname, l.usesysid, l.usename, l.application_name, l.client_addr) WHERE l.sample_id = s_id - $3"]}, {"hexqueryid": "df4b841009eec504", "query_texts": ["SELECT name,blks_zeroed,blks_hit,blks_read,blks_written,blks_exists,flushes,truncates,stats_reset FROM pg_catalog.pg_stat_slru WHERE greatest(blks_zeroed,blks_hit,blks_read,blks_written,blks_exists,flushes,truncates) > $1"]}, {"hexqueryid": "e01b2b5181ddb633", "query_texts": ["SELECT $3 FROM ONLY \"profile\".\"samples\" x WHERE \"server_id\" OPERATOR(pg_catalog.=) $1 AND \"sample_id\" OPERATOR(pg_catalog.=) $2 FOR KEY SHARE OF x"]}, {"hexqueryid": "e05abebbfaebdc73", "query_texts": ["INSERT INTO sample_act_backend ( server_id, sample_id, pid, backend_start, datid, datname, usesysid, usename, client_addr, client_hostname, client_port, backend_type, backend_last_ts ) WITH last_backend_state AS ( SELECT server_id, sample_id, pid, backend_start, max(subsample_ts) as subsample_ts FROM last_stat_activity WHERE (server_id, sample_id) = (sserver_id, s_id - $3) GROUP BY server_id, sample_id, pid, backend_start ) SELECT server_id, s_id as sample_id, pid, backend .sample_id) = (sserver_id, s_id) GROUP BY cur.server_id, cur.sample_id, cur.datid, cur.tablespaceid"]}, {"hexqueryid": "e5041a9e823d82a2", "query_texts": ["UPDATE last_stat_tables ulst SET in_sample = $5 FROM ( SELECT cur.server_id AS server_id, cur.sample_id AS sample_id, cur.datid AS datid, cur.relid AS relid, tcur.relid AS toastrelid, cur.relsize IS NOT NULL AS relsize_avail, cur.relpages_bytes IS NOT NULL AS relpages_avail, row_number() OVER (ORDER BY cur.relsize - COALESCE(lst.relsize, $6) + COALESCE(tcur.relsize,$7) - COALESCE(tlst.relsize, $8) DESC NULLS LAST) growth_rank, row_number() OVER (ORDER BY cur.relpages_bytes - COALESCE(lst.relpages_bytes, $9) + COALESCE(tcur.relpages_bytes,$10) - COALESCE(tlst.relpages_bytes, $11) DESC NULLS LAST) pagegrowth_rank FROM -- main relations diff last_stat_tables cur LEFT OUTER JOIN last_stat_tables lst ON (lst.server_id, lst.sample_id, lst.datid, lst.relid) = (sserver_id, s_id - $12, cur.datid, cur.relid) -- toast relations diff LEFT OUTER JOIN last_stat_tables tcur ON (tcur.server_id, tcur.sample_id, tcur.datid, tcur.relid) = (sserver_id, s_id, cur.datid, cur.reltoastrelid) LEFT OUTER JOIN last_stat_tables tlst ON (tlst.server_id, tlst.sample_id, tlst.datid, tlst.relid) = (sserver_id, s_id - $13, lst.datid, lst.reltoastrelid) WHERE (cur.server_id, cur.sample_id) = (sserver_id, s_id) AND cur.relkind IN ($14,$15)) diff WHERE ((relsize_avail AND growth_rank &lt;= topn) OR ((NOT relsize_avail) AND relpages_avail AND pagegrowth_rank &lt;= topn)) AND (ulst.server_id, ulst.sample_id, ulst.datid, in_sample) = (sserver_id, s_id, diff.datid, $16) AND (ulst.relid = diff.relid OR ulst.relid = diff.toastrelid)"]}, {"hexqueryid": "e6217574629ac4c2", "query_texts": ["copy pgbench_accounts from stdin with (freeze on)"]}, {"hexqueryid": "e65f09e84bf86971", "query_texts": ["INSERT INTO pgbench_history (tid, bid, aid, delta, mtime) VALUES ($1, $2, $3, $4, CURRENT_TIMESTAMP)"]}, {"hexqueryid": "e8661b192d6d8370", "query_texts": ["SELECT collect_pg_wait_sampling_stats(server_properties, sserver_id, s_id, topn)"]}, {"hexqueryid": "ebc50fb341da08d3", "query_texts": ["INSERT INTO grow_table_renamed (short_str,long_str) SELECT array_to_string(array (select substr($1, trunc(random() * $2)::integer + $3, $4) FROM generate_series($5, $6)), $7), array_to_string(array (select substr($8, trunc(random() * $9)::integer + $10, $11) FROM generate_series($12, $13)), $14) FROM generate_series($15,$16)"]}, {"hexqueryid": "ec152442dc0ebf66", "query_texts": ["SELECT abalance FROM pgbench_accounts WHERE aid = $1"]}, {"hexqueryid": "ee684f1e23fcd91d", "query_texts": ["select count($1) as pgpro_fxs from pg_catalog.pg_proc where proname IN ($2,$3,$4)"]}, {"hexqueryid": "ee9d62b78c8fe566", "query_texts": ["INSERT INTO sample_act_statement( server_id, sample_id, pid, leader_pid, xact_start, query_start, query_id, act_query_md5, stmt_last_ts ) VALUES ( sserver_id, s_id, qres.pid, qres.leader_pid, qres.xact_start, qres.query_start, qres.query_id, left(encode(sha224(convert_to(qres.query,$23)), $24), $25), qres.subsample_ts )"]}, {"hexqueryid": "ef793f224f7c3458", "query_texts": ["UPDATE tables_list utl SET last_sample_id = s_id - $5 FROM tables_list tl LEFT JOIN sample_stat_tables cur ON (cur.server_id, cur.sample_id, cur.datid, cur.relid) = (sserver_id, s_id, tl.datid, tl.relid) WHERE tl.last_sample_id IS NULL AND tl.server_id = sserver_id AND cur.server_id IS NULL AND (utl.server_id, utl.datid, utl.relid) = (sserver_id, tl.datid, tl.relid)"]}, {"hexqueryid": "f6190352b11b5e03", "query_texts": ["SELECT $1::text", "SELECT '&lt;!DOCTYPE html>&lt;html lang=\"en\">&lt;head>&lt;style>{static:css}&lt;/style>&lt;script>const data={dynamic:data1}&lt;/script>&lt;title>Postgres profile report ({properties:start1_id} - {properties:end1_id})&lt;/title>&lt;/head>&lt;body>&lt;H1>Postgres profile report&lt;/H1>&lt;div id=\"topnav\" class=\"topnav\">&lt;/div>&lt;ul id=\"content\">&lt;/ul>&lt;div id=\"container\">&lt;/div>&lt;script>{static:script_js}&lt;/script>&lt;/body>&lt;/html>'::text"]}, {"hexqueryid": "f7322f3853b2b1ac", "query_texts": ["INSERT INTO last_stat_tables( server_id, sample_id, datid, relid, schemaname, relname, seq_scan, seq_tup_read, idx_scan, idx_tup_fetch, n_tup_ins, n_tup_upd, n_tup_del, n_tup_hot_upd, n_live_tup, n_dead_tup, n_mod_since_analyze, n_ins_since_vacuum, last_vacuum, last_autovacuum, last_analyze, last_autoanalyze, vacuum_count, autovacuum_count, analyze_count, autoanalyze_count, heap_blks_read, heap_blks_hit, idx_blks_read, idx_blks_hit, toast_blks_read, toast_blks_hit, tidx_blks_read, tidx_blks_hit, relsize, relsize_diff, tablespaceid, reltoastrelid, relkind, in_sample, relpages_bytes, relpages_bytes_diff, last_seq_scan, last_idx_scan, n_tup_newpage_upd ) SELECT sserver_id, s_id, qres.datid, dbl.relid, dbl.schemaname, dbl.relname, dbl.seq_scan AS seq_scan, dbl.seq_tup_read AS seq_tup_read, dbl.idx_scan AS idx_scan, dbl.idx_tup_fetch AS idx_tup_fetch, dbl.n_tup_ins AS n_tup_ins, dbl.n_tup_upd AS n_tup_upd, dbl.n_tup_del AS n_tup_del, dbl.n_tup_hot_upd AS n_tup_hot_upd, dbl.n_live_tup AS n_live_tup, dbl.n_dead_tup AS n_dead_tup, dbl.n_mod_since_analyze AS n_mod_since_analyze, dbl.n_ins_since_vacuum AS n_ins_since_vacuum, dbl.last_vacuum, dbl.last_autovacuum, dbl.last_analyze, dbl.last_autoanalyze, dbl.vacuum_count AS vacuum_count, dbl.autovacuum_count AS autovacuum_count, dbl.analyze_count AS analyze_count, dbl.autoanalyze_count AS autoanalyze_count, dbl.heap_blks_read AS heap_blks_read, dbl.heap_blks_hit AS heap_blks_hit, dbl.idx_blks_read AS idx_blks_read, dbl.idx_blks_hit AS idx_blks_hit, dbl.toast_blks_read AS toast_blks_read, dbl.toast_blks_hit AS toast_blks_hit, dbl.tidx_blks_read AS tidx_blks_read, dbl.tidx_blks_hit AS tidx_blks_hit, dbl.relsize AS relsize, dbl.relsize_diff AS relsize_diff, CASE WHEN dbl.tablespaceid=$18 THEN qres.tablespaceid ELSE dbl.tablespaceid END AS tablespaceid, NULLIF(dbl.reltoastrelid, $19), dbl.relkind, $20, dbl.relpages_bytes, dbl.rel st.relid) = (sserver_id, s_id - $29, dblst.datid, lst.reltoastrelid) WHERE (cur.server_id, cur.sample_id, cur.in_sample) = (sserver_id, s_id, $30) AND cur.relkind IN ($31,$32)) diff WHERE least( scan_rank, dml_rank, dead_pct_rank, mod_pct_rank, vacuum_dml_rank, read_rank, gets_rank, vacuum_rank, analyze_rank, newpage_upd_rank ) &lt;= topn AND (ulst.server_id, ulst.sample_id, ulst.datid, ulst.in_sample) = (sserver_id, s_id, diff.datid, $33) AND (ulst.relid = diff.relid OR ulst.relid = diff.toastrelid)"]}, {"hexqueryid": "fc03561729fa588", "query_texts": ["SELECT * FROM dblink('server_connection', 'SELECT name, ' 'reset_val, ' 'unit, ' 'pending_restart ' 'FROM pg_catalog.pg_settings ' 'WHERE name IN (' '''server_version_num''' ')') AS dbl(name text, reset_val text, unit text, pending_restart boolean)"]}, {"hexqueryid": "10776c12f56ff984", "query_texts": ["SELECT st.userid,st.userid::regrole AS username,st.dbid,st.queryid,st.toplevel,st.plans,st.total_plan_time,st.min_plan_time,st.max_plan_time,st.mean_plan_time,st.stddev_plan_time,st.calls,st.total_exec_time,st.min_exec_time,st.max_exec_time,st.mean_exec_time,st.stddev_exec_time,st.rows,st.shared_blks_hit,st.shared_blks_read,st.shared_blks_dirtied,st.shared_blks_written,st.local_blks_hit,st.local_blks_read,st.local_blks_dirtied,st.local_blks_written,st.temp_blks_read,st.temp_blks_written,st.blk_read_time as shared_blk_read_time,st.blk_write_time as shared_blk_write_time,st.wal_records,st.wal_fpi,st.wal_bytes, st.jit_functions, st.jit_generation_time, st.jit_inlining_count, st.jit_inlining_time, st.jit_optimization_count, st.jit_optimization_time, st.jit_emission_count, st.jit_emission_time, st.temp_blk_read_time, st.temp_blk_write_time, $1 as local_blk_read_time, $2 as local_blk_write_time, $3 as jit_deform_count, $4 as jit_deform_time, $5 as stats_since, $6 as minmax_stats_since FROM public.pg_stat_statements($7) st"]}, {"hexqueryid": "108afc96d1ae686e", "query_texts": ["UPDATE sample_stat_indexes_total ussit SET rel class Utilities {
    static sort(data, key, direction) {
        return structuredClone(data.sort((a, b) => {
            if (a[key] < b[key]) {
                return -1 * direction;
            } else if (a[key] > b[key]) {
                return direction;
            } else {
                return 0;
            }
        }))
    }
    static sum(data, key) {
        return data.reduce((partialSum, a) => partialSum + a[key], 0);
    }
    static filter(data, key) {
        if (key.type === "exists") {
            if (data.every(obj => key["field"] in obj)) {
                return structuredClone(data.filter(obj => obj[key["field"]]));
            }
        } else if (key.type === "equal") {
            if (data.every(obj => key["field"] in obj)) {
                return structuredClone(data.filter(obj => obj[key["field"]] === key["value"]));
            }
        }
        return data;
    }
    static find(data, key, value) {
        return structuredClone(data.filter(obj => obj[key] === value));
    }
    static limit(data, num) {
        if (num > 0) {
            return structuredClone(data.slice(0, num));
        }
        return data;
    }
    static getInputField() {
        return document.getElementById('inputField');
    }
    static cancelSearchResults(rowsForSearch) {
        rowsForSearch.forEach(row => {
            row.style.display = '';
        })
        this.getInputField().value = '';
    }
    static searchQueryWithStatistics(rowsForSearch, keyword) {
        let foundQueries = Utilities.searchQueryText(keyword);
        rowsForSearch.forEach(row => {
            if (row.dataset["hexqueryid"]
                && foundQueries[row.dataset["hexqueryid"]]) {
                row.style.display = '';
            } else {
                row.style.display = 'none';
                if (row.nextSibling && row.nextSibling.classList.contains('queryRow')) {
                    row.nextSibling.style.display = 'none';
                }
            }
        })
    }
    static searchQueryText(keyword) {
        let foundQueries = {};
        data.datasets.queries.forEach(query => {
            Object.keys(query).forEach(key => {
                query.query_texts.forEach(query_text => {
                    if (query_text && query_text.toLowerCase().includes(keyword) && !foundQueries[query["hexqueryid"]]) {
                        foundQueries[query["hexqueryid"]] = true;
                    }
                })
            })
            if (query.plans) {
                query.plans.forEach(plan => {
                    if (plan.plan_text.toLowerCase().includes(keyword) && !foundQueries[query["hexqueryid"]]) {
                        foundQueries[query["hexqueryid"]] = true;
                    }
                })
            }
        })
        return foundQueries;
    }
    static searchWithParam(rowsForSearch, keyword, searchParam) {
        let foundQueries = {};
        if (searchParam === 'all') {
            foundQueries = Utilities.searchQueryText(keyword)
        }
        rowsForSearch.forEach(row => {
            if (row.dataset[searchParam] && row.dataset[searchParam].toLowerCase().includes(keyword)) {
                row.style.display = '';
                if (row.dataset["hexqueryid"]) {
                    foundQueries[row.dataset["hexqueryid"]] = true;
                }
            } else {
                row.style.display = 'none';
                if (row.nextSibling && row.nextSibling.classList.contains('queryRow')) {
                    row.nextSibling.style.display = 'none';
                }
            }
        })
        rowsForSearch.forEach(row => {
            if (row.parentNode.id === 'sqllist_t' || searchParam === 'all') {
                if (foundQueries[row.dataset["hexqueryid"]]) {
                    row.style.display = '';
                }
            } else {
                if (foundQueries[row.dataset["hexqueryid"]] && row.dataset[searchParam].toLowerCase().includes(keyword)) {
                    row.style.display = '';
                }
            }
        })
    }
    static search(rowsForSearch, searchParam, keyword) {
        keyword = keyword.toLowerCase();
        if (!keyword) {
            Utilities.cancelSearchResults(rowsForSearch);
        } else if (searchParam === 'querytext') {
            Utilities.searchQueryWithStatistics(rowsForSearch, keyword);
        } else {
            Utilities.searchWithParam(rowsForSearch, keyword, searchParam);
        }
    }
}
class BaseChart {
    static drawIntoTable(cls, newRow, column, data) {
        let key = column.ordering[0] === '-' ? column.ordering.substring(1) : column.ordering;
        let value = column.id;
        let direction = column.ordering[0] === '-' ? -1 : 1;
        let newCell = newRow.insertCell(-1);
        newCell.setAttribute('class', column.class);
        if (Utilities.sum(data, value) > 0) {
            let orderedData = Utilities.sort(data, key, direction);
            let svg = cls.drawSVG(orderedData, value, key);
            newCell.insertAdjacentHTML('beforeend', svg);
        }
    }
}
class PipeChart extends BaseChart {
    static drawSVG(orderedData, value, key) {
        let x = 0; // Start position of nested svg
        let nestedSvg = '';
        orderedData.forEach(elem => {
            let width = Math.floor(elem[value]);
            nestedSvg += `
                <svg height="2em" width="${width}%" x="${x}%">
                    <title>${elem.objname}: ${elem[value]}</title>
                    <rect height="90%" x="0%" y="10%" ry="15%" stroke="black" stroke-width="1px" width="100%" fill="#${elem.objcolor}"></rect>
                    <text x="0.3em" y="70%">${elem.objname}: ${elem[key]}</text>
                </svg>
            `;
            x += width;
        })
        let svg = `
            <svg 
                height="2em" 
                width="100%">
                ${nestedSvg}
            </svg>
        `;
        return svg;
    }
    static drawIntoTable(newRow, column, data) {
        BaseChart.drawIntoTable(PipeChart, newRow, column, data);
        return true;
    }
}

    init(newBlock, threshold_backend=null, threshold_xact=null, threshold_state=null) {
        let div = document.createElement('div');
        div.setAttribute('id', 'stateChangeSVG');
        let stateChanging = {};
        let reportStartUT = data.properties.report_start1_ut;
        let reportEndUT = data.properties.report_end2_ut ? data.properties.report_end2_ut : data.properties.report_end1_ut;
        let reportDuration = reportEndUT - reportStartUT;
        let totalSVGWidth = 1520;
        if (document.documentElement.offsetWidth) {
            totalSVGWidth = Math.ceil(0.85 * document.documentElement.offsetWidth / 12) * 12;
        }
        let timeLineWidth = 4;
        let proportion = totalSVGWidth / reportDuration;
        let linesCount = Math.ceil(totalSVGWidth / timeLineWidth);
        newBlock.data.forEach(elem => {
            let backend_duration = elem.backend_duration_ut;
            let xact_duration = elem.xact_duration_ut;
            let state_duration = elem.xact_duration_ut;
            if (backend_duration < threshold_backend) {
                return;
            }
            if (xact_duration < threshold_xact) {
                return;
            }
            if (state_duration < threshold_state) {
                return;
            }
            let state_change = {};
            state_change[elem.state_change_ut] = {
                'pid': elem.pid,
                'state': elem.state,
                'start_ut': elem.state_change_ut,
                'start': elem.state_change,
                'duration': elem.state_duration_ut,
                'state_code': elem.state_code,
                'query_id': elem.query_id
            };
            if (stateChanging[`${elem.pid}_${elem.backend_start_ut}`] === undefined) {
                // Backend statistics
                let xact = {}
                xact[elem.xact_start_ut] = {
                    'pid': elem.pid,
                    'start_ut': elem.xact_start_ut,
                    'start': elem.xact_start,
                    'duration': elem.xact_duration_ut,
                    'state_changes': state_change
                }
                stateChanging[`${elem.pid}_${elem.backend_start_ut}`] = {
                    'pid': elem.pid,
                    'start': elem.backend_start,
                    'start_ut': elem.backend_start_ut,
                    'duration': elem.backend_duration_ut,
                    'count': 1,
                    'xacts': xact
                }
            } else {
                if (stateChanging[`${elem.pid}_${elem.backend_start_ut}`].xacts[elem.xact_start_ut] === undefined) {
                    stateChanging[`${elem.pid}_${elem.backend_start_ut}`].xacts[elem.xact_start_ut] = {
                        'pid': elem.pid,
                        'start_ut': elem.xact_start_ut,
                        'start': elem.xact_start,
                        'duration': elem.xact_duration_ut,
                        'state_changes': state_change
                    };
                } else {
                    stateChanging[`${elem.pid}_${elem.backend_start_ut}`]
                        .xacts[elem.xact_start_ut]
                        .state_changes[elem.state_change_ut] = state_change[elem.state_change_ut];
                }
                stateChanging[`${elem.pid}_${elem.backend_start_ut}`].count += 1;
            }
        })
        let backends = Object.keys(stateChanging).map((key) => stateChanging[key]);
        let statesByStart = structuredClone(backends.sort((a,b) => a.start_ut - b.start_ut));
        let statesByEnd = structuredClone(backends.sort((a,b) => (a.start_ut + a.duration) - (b.start_ut + b.duration)));
        let statesByEndPointer = 0;
        let s = 0;
        for (let statesByStartPointer = 0; statesByStartPointer < statesByStart.length; statesByStartPointer++) {
            let firstBackend = statesByStart[statesByStartPointer];
            let firstBackendID = `${firstBackend.pid}_${firstBackend.start_ut}`
            let secondBackend = statesByEnd[statesByEndPointer];
            let secondBackendID = `${secondBackend.pid}_${secondBackend.start_ut}`
            let charCount = firstBackend.pid.toString().length ? firstBackend.pid.toString().length : 4;
            let charToTime = charCount * 8 * 1.2 / proportion;
            let isLater = (firstBackend.start_ut - charToTime) > secondBackend.start_ut + secondBackend.duration;
            if (isLater) {
                stateChanging[firstBackendID]['chart_line'] = stateChanging[secondBackendID]['chart_line'];
                statesByEndPointer += 1;
            } else {
                s += 1;
                stateChanging[firstBackendID]['chart_line'] = s;
            }
        }
        let StateChangeSVGNested = '';
        Object.keys(stateChanging).forEach(backend => {
            let colour;
            let backendObj = stateChanging[backend];
            // Drawing rectangle with backend 
            let title = '';
            title += `PID: ${backendObj.pid}\n`;
            title += `Backend start: ${new Date(backendObj.start_ut * 1000)}\n`;
            title += `Backend duration: ${Math.round(backendObj.duration * 100) / 100} sec`;
            let backendSVG = this.drawRect(backendObj, reportStartUT, proportion, backendObj['chart_line'], this.colours[2], this.colours[17], title, 'backend');
            // Drawing PID
            let pidSVG = this.drawPID(backendObj, reportStartUT, proportion, backendObj['chart_line']);
            StateChangeSVGNested += backendSVG;
            StateChangeSVGNested += pidSVG;
            Object.keys(backendObj.xacts).forEach(xact => {
                let xactObj = backendObj.xacts[xact];
                let title = '';
                title += `PID: ${xactObj.pid}\n`;
                title += `Xact start: ${new Date(xactObj.start_ut * 1000)} \n`;
                title += `Xact duration: ${Math.round(xactObj.duration * 100) / 100} sec \n`;
                title += `Backend start: ${new Date(backendObj.start_ut * 1000)} \n`;
                title += `Backend duration: ${Math.round(backendObj.duration * 100) / 100} sec`;
                let xactSVG = this.drawRect(xactObj, reportStartUT, proportion, backendObj['chart_line'], this.colours[2], this.colours[17], title, 'xact');
                StateChangeSVGNested += xactSVG;
                Object.keys(xactObj.state_changes).forEach(state_change => {
                    let stateChangeObj = xactObj.state_changes[state_change];
                    if (stateChangeObj.state_code === 1) {
                        // idle in transaction
                        colour = this.colours[6]
                    } else if (stateChangeObj.state_code === 3) {
                        // active
                        colour = this.colours[9]
                    }
                    let title = '';
                    title += `PID: ${stateChangeObj.pid} \n`;
                    title += `State: ${stateChangeObj.state} \n`;
                    title += `Query ID: ${stateChangeObj.query_id}\n`;
                    title += `State start: ${new Date(stateChangeObj.start_ut * 1000)} \n`;
                    title += `State duration: ${Math.round(stateChangeObj.duration * 100) / 100} sec \n`;
                    title += `Xact start: ${new Date(xactObj.start_ut * 1000)} \n`;
                    title += `Xact duration: ${Math.round(xactObj.duration * 100) / 100} sec \n`;
                    title += `Backend start: ${new Date(backendObj.start_ut * 1000)} \n`;
                    title += `Backend duration: ${Math.round(backendObj.duration * 100) / 100} sec`;
                    // dataObj, reportStartUT, proportion, num, strokeColour, fillColour, title, klass
                    let stateChangeSVG = this.drawRect(
                        stateChangeObj, 
                        reportStartUT, 
                        proportion, 
                        backendObj['chart_line'],
                        colour, 
                        colour, 
                        title, 
                        'stateChange',
                        `${backendObj.pid}_${xactObj.start_ut}_${stateChangeObj.start_ut}`
                    );
                    StateChangeSVGNested += stateChangeSVG;
                })
            })
        })
        // Drawing timeline grid
        let timeGridNestedSVG = '';
        for (let i = 0; i <= linesCount; i++) {
            let pointTime = new Date((i * timeLineWidth / proportion + reportStartUT) * 1000);
            let timeLineSVG = `
                <path 
                    id="line${i}" 
                    d="M ${i * timeLineWidth} 0 L ${i * timeLineWidth} ${(s + 1) * 20 }"
                    stroke="lightgrey" 
                    stroke-dasharray="1">
                </path>
            `;
            let hiddenLineSVG = `
                <path 
                    d="M ${i * timeLineWidth} 0 L ${i * timeLineWidth} ${(s + 1) * 20}"
                    stroke="white"
                    stroke-width="${timeLineWidth}"
                    >
                    <title>${pointTime}</title>
                </path>
            `;
            timeGridNestedSVG += hiddenLineSVG;
            timeGridNestedSVG += timeLineSVG;
        }
        let StateChangeSVG = `<svg>${StateChangeSVGNested}</svg>`
        let timeGridSVG = `<svg>${timeGridNestedSVG}</svg>`;
        let svg = `
            <svg 
                width="${totalSVGWidth}px"
                height="${(s * 20) + 20}px"
            >
                ${timeGridSVG}
                ${StateChangeSVG}
            </svg>
        `;
        div.insertAdjacentHTML('beforeend', svg);
        div.style.display = 'flex';
        div.style.flexDirection = 'column';
        div.querySelectorAll('rect.stateChange').forEach(elem => {
            elem.addEventListener('click', e => {
                let target = e.target.dataset.target;
                window.location.replace(`#${target}`);
                let targetNode = document.getElementById(target);
                targetNode.click();
            })
        })
        return div;
    }
    drawSessionChartLegend() {
        // Create legend
        let legend = document.createElement('div');

        legend.style.flexDirection = 'column';
        legend.appendChild(this.drawLegend(this.colours[6], 'idle in transaction'));

class BaseSection {
    constructor(section) {
        this.section = section;
        this.sectionHasContent = ('content' in section);
        this.sectionHasTable = ('header' in section);
        this.sectionHasTitle = ('tbl_cap' in section);
    }
    static buildTitle(section) {
        let title = document.createElement('h3');
        title.innerHTML = section.tbl_cap;
        title.id = section.sect_id;
        return title;
    }
    init() {
        let div = document.createElement('div');
        if (this.section.sect_id) {
            div.setAttribute('id', this.section.sect_id);
        }
        if (this.sectionHasTitle) {
            div.appendChild(BaseSection.buildTitle(this.section));
        }
        if (this.sectionHasContent) {
            let contentClass = this.section.content.class;
            let contentText = this.section.content.text;
            let contentDiv = document.createElement('div');
            contentDiv.classList.add(contentClass);
            contentDiv.innerHTML = contentText;
            div.appendChild(contentDiv);
        }
        if (this.sectionHasTable) {
            let table = document.createElement('table');
            table.setAttribute('id', `${this.section.sect_id}_t`);
            for (let i = 0; i < this.section.header.length; i++) {
                let newBlock = structuredClone(this.section);
                newBlock.header = this.section.header[i];
                if (newBlock.header.source) {
                    newBlock.data = data.datasets[newBlock.header.source];
                    if (newBlock.header.filter) {
                        newBlock.data = Utilities.filter(newBlock.data, newBlock.header.filter);
                    }
                    if (newBlock.header.ordering) {
                        let direction = 1;
                        let key = newBlock.header.ordering;
                        if (newBlock.header.ordering.startsWith('-')) {
                            direction = -1;
                            key = newBlock.header.ordering.slice(1);
                        }
                        newBlock.data = Utilities.sort(newBlock.data, key, direction);
                    }
                    if (newBlock.header.limit) {
                        newBlock.data = Utilities.limit(newBlock.data, Number.parseInt(data.properties[newBlock.header.limit]));
                    }
                } else {
                    newBlock.data = this.section.data[i];
                }
                table.setAttribute('class', newBlock.header.class);
                if (newBlock.header["highlight"]) {
                    table.classList.add('highlight');
                }
                if (newBlock.header["preview"]) {
                    table.classList.add('preview');
                }
                if (newBlock.header.type === 'row_table') {
                    div.appendChild(new HorizontalTable(newBlock, table).init());
                } else if (newBlock.header.type === 'column_table') {
                    div.appendChild(new VerticalTable(newBlock, table).init());
                } else if (newBlock.header.type === 'chart') {
                    div.appendChild(SessionChart.initTreshold(newBlock));
                    let sessionChart = new SessionChart();
                    div.appendChild(sessionChart.init(newBlock));
                    div.appendChild(sessionChart.drawSessionChartLegend());
                }
            }
        }
        return div;
    }
}

class HorizontalTable extends BaseTable {
    static buildCell(newRow, column, row) {
        let specialClass = BaseTable.hasSpecialClass(column);
        if (specialClass) {
            let notEmpty = BaseTable.uniqueCells[specialClass](newRow, column, row);
            return !notEmpty;
        }
        let newCell = newRow.insertCell(-1);
        if (column.rowspan) {
            newCell.setAttribute('rowspan', '2');
        }
        if (column.class) {
            newCell.setAttribute('class', column.class);
        }
        if (row[column.id]) {
            let newText = document.createTextNode(row[column.id]);
            newCell.appendChild(newText);
            return false;
        }
        return true;
    }
    static collectColumns(header, array, matrix) {
        if (array === null) {
            array = [];
        }
        if (matrix === null) {
            matrix = [];
        }
        if ('columns' in header) {
            for (let i = 0; i < header.columns.length; i++) {
                let column = header.columns[i];
                HorizontalTable.collectColumns(column, array, matrix);
            }
        } else {
            if (typeof header.id === 'string') {
                array.push(header);
            } else if (typeof header.id === 'object') {
                matrix.push(BaseTable.bifurcateObject(header));
            }
        }
        if (matrix.length) {
            matrix = matrix[0].map((_, colIndex) => matrix.map(row => row[colIndex]));
        }
        return [array, matrix];
    }
    static getColumns(columns) {
        let matrixCollection = HorizontalTable.collectColumns(columns, null, null);
        let singeRowColumns = matrixCollection[0];
        let matrixWithVectors = matrixCollection[1];
        let newMatrix = Array.from(matrixCollection[1]);
        if (matrixWithVectors[0]) {
            newMatrix[0] = singeRowColumns.concat(matrixWithVectors[0]);
        } else {
            newMatrix[0] = singeRowColumns;
        }
        return newMatrix;
    }
    static setDataAttrs(newRow, row, dataAttrs) {
        let searchArray = [];
        if (dataAttrs) {
            dataAttrs.forEach(attr => {
                newRow.setAttribute(`data-${attr.id}`, row[attr.id]);
                searchArray.push(row[attr.id]);
            })
            let searchString = Object.values(searchArray).join(' ').replace(/\s\s+/g, ' ');
            newRow.setAttribute('data-all', searchString);
        }
    }
    static setId(newRow, row, dataAttrs) {
        let data = new Array();
        dataAttrs.forEach(item => {
            data.push(row[item]);
        });
        let customId = data.join("_");
        newRow.setAttribute('id', customId)
    }
    insertRows() {
        let columns = HorizontalTable.getColumns(this.section.header);  // Getting columns matrix
        let highlightRowAttrs = this.section.header.highlight;
        let previewQueryAttrs = this.section.header.preview;
        let scrollQueryAttrs = this.section.header.scroll;
        let rows = this.section.data;  // Getting json array with data
        if (highlightRowAttrs) {
            let result = JSON.stringify(highlightRowAttrs);
            this.table.setAttribute('data-highlight', result);
        }
        if (previewQueryAttrs) {
            let result = JSON.stringify(previewQueryAttrs);
            this.table.setAttribute('data-preview', result);
        }
        if (scrollQueryAttrs) {
            let scrollAttrs = JSON.stringify(scrollQueryAttrs);
            this.table.setAttribute('data-scroll', scrollAttrs);
        }
        for (let i = 0; i < rows.length; i++) {
            let row = rows[i];
            for (let j = 0; j < columns.length; j++) {
                let newRow = this.table.insertRow(-1);
                if (columns.length > 1) {
                    newRow.classList.add(`int${j + 1}`);
                }
                if (row.klass) {
                    newRow.classList.add(row.klass);
                }
                if (i % 2 !== 0) {
                    newRow.classList.add('grey');
                }
                if (highlightRowAttrs) {
                    HorizontalTable.setDataAttrs(newRow, row, highlightRowAttrs);
                }
                if (previewQueryAttrs) {
                    HorizontalTable.setDataAttrs(newRow, row, previewQueryAttrs);
                }
                if (scrollQueryAttrs) {
                    HorizontalTable.setId(newRow, row, scrollQueryAttrs);
                }
                let isEmpty = [];
                for (let k = 0; k < columns[j].length; k++) {
                    let column = columns[j][k];
                    isEmpty.push(HorizontalTable.buildCell(newRow, column, row));
                }
                if (isEmpty.every(Boolean)) {
                    newRow.style.visibility = 'collapse';
                    let prevSib = newRow.previousSibling;
                    prevSib.style.verticalAlign = 'baseline';
                }
            }
        }
    }

class VerticalTable extends BaseTable {
    static getColumns(section) {
        let columns = [];
        let rows = section.header.rows;
        for (let i = 0; i < rows.length; i++) {
            if (typeof rows[i].id === 'object') {
                columns.push(BaseTable.bifurcateObject(rows[i]));
            } else {
                columns.push(rows[i]);
            }
        }
        return columns;
    }
    static buildCell(newRow, column, row) {
        let specialClass = BaseTable.hasSpecialClass(column);
        if (specialClass) {
            BaseTable.uniqueCells[specialClass](newRow, column, row);
            return;
        }
        let newCell = newRow.insertCell(-1);
        if ('caption' in column) {
            let newText = document.createTextNode(column['caption']);
            newCell.appendChild(newText);
        }
        if ('title' in column) {
            newCell.setAttribute('title', column.title);
        }
        if ('id' in column) {
            newCell.innerHTML = row[0][column.id];
        }
        if ('class' in column) {
            newCell.setAttribute('class', column.class);
        }
    }
    insertRows() {
        let columns = VerticalTable.getColumns(this.section);
        let rows = this.section.data;
        for (let i = 0; i < columns.length; i++) {
            let newRow = this.table.insertRow(-1);
            if (i % 2 !== 0) {
                newRow.classList.add('grey');
            }
            VerticalTable.buildCell(newRow, columns[i], rows);
            columns[i].cells.forEach(cell => {
                VerticalTable.buildCell(newRow, cell, rows);
            });
        }
    }
}
class Highlighter {
    static transition = 'background-color 70ms';
    static toggleClass(tr, allRows) {
        Highlighter.cleanAllActiveClasses(allRows);
        if (Object.keys(tr.dataset).length && !tr.classList.contains('active')) {
            allRows.forEach((row) => {
                let isEqual = Highlighter.isDatasetEqual(tr, row);
                if (isEqual) {
                    Highlighter.setBackgroundColorToRow(row, '', this.transition);
                    row.classList.add('active');
                    let navId = this.getClosestTag(row, 0, 'div').firstChild.id;
                    if (navId) {
                        let navLi = document.getElementById(`menu_${navId}`);
                        if (navLi && !navLi.classList.contains('active')) {
                            navLi.classList.add('active');
                        }
                    }
                }
            });
        }
    }
    static getAllRows() {
        return document.querySelectorAll('tr');
    }
    static getHighlightableRows() {
        return document.querySelectorAll('table.highlight tr:not(.queryRow)');
    }
    static getClosestTag(target, curDeep, targetTag) {
        let tooDeep = curDeep >= 5;
        let headOfTable = target.tagName.toLowerCase() === 'th';
        let stillNotRow = target.tagName.toLowerCase() !== targetTag;
        if (tooDeep) {
            return false;
        } else if (headOfTable) {
            return false;
        } else if (stillNotRow) {
            curDeep++;
            return Highlighter.getClosestTag(target.parentNode, curDeep, targetTag);
        } else {
            return target;
        }
    }
    static cleanAllActiveClasses(rows) {
        rows.forEach(elem => {
            if (elem.classList.contains('active')) {
                elem.classList.remove('active');
            }
        })
        let menu = document.getElementById('sections');
        if (menu) {
            let allItems = document.querySelectorAll('li');
            allItems.forEach(item => {
                if (item.classList.contains('active')) {
                    item.classList.remove('active');
                }
            })
        }
    }
    static getTargetDS(tr) {
        let fieldsList = JSON.parse(tr.closest('table').dataset.highlight);
        let targetDS = {};
        fieldsList.forEach(field => {
            targetDS[field.id] = tr.dataset[field.id]
        })
        return targetDS;
    }
    static isDatasetEqual(tr, row) {
        let targetDataset = Highlighter.getTargetDS(tr);
        let rowDataset = row.dataset;
        let trIsSqlList = Highlighter.getClosestTag(tr, 0, 'table').id === 'sqllist_t';
        let rowIsSqlList = Highlighter.getClosestTag(row, 0, 'table').id === 'sqllist_t';
        let isSameQuery = targetDataset.hexqueryid !== undefined
            && targetDataset.hexqueryid === rowDataset.hexqueryid
            && targetDataset.planid === rowDataset.planid;
        if ((trIsSqlList || rowIsSqlList) && isSameQuery) {
            return true;
        }
        for (let data in targetDataset) {
            if (targetDataset[data] === '*' && rowDataset[data] !== undefined) {
                continue;
            }
            if (data === 'all') {
                continue;
            }
            if (targetDataset[data] !== rowDataset[data]) {
                return false;
            }
        }
        return true;
    }
    static setBackgroundColorToRow(tr, hoverColor, transition) {
        tr.querySelectorAll('td').forEach(td => {
            td.style.backgroundColor = hoverColor;
            td.style.transition = transition;
        })
        let siblings = null;
        if (tr.classList.contains('int1')) {
            siblings = tr.nextSibling.querySelectorAll('td');
        } else if (tr.classList.contains('int2')) {
            siblings = tr.previousSibling.querySelectorAll('td');
        }
        if (siblings) {
            siblings.forEach(elem => {
                elem.style.backgroundColor = hoverColor;
                elem.style.transition = transition;
            })
        }
    }
    static highlight(event, allRows) {
        if (event.target.tagName.toLowerCase() !== 'a') {
            let tr = Highlighter.getClosestTag(event.target, 0, 'tr');
            if (tr && Object.keys(tr.dataset).length) {
                Highlighter.toggleClass(tr, allRows);
            }
        }
    }
    static smartHover(eventType, event, transition) {
        let hoverColor = '#D9FFCC';
        let tr = Highlighter.getClosestTag(event.target, 0, 'tr');
        if (tr && !tr.classList.contains('active') && eventType === 'mouseover') {
            Highlighter.setBackgroundColorToRow(tr, hoverColor, transition);
        } else if (tr && eventType === 'mouseout') {
            Highlighter.setBackgroundColorToRow(tr, '', transition);
        }
    }
    static init() {
        const ALL_ROWS = Highlighter.getAllRows();
        const HIGHLIGHTABLE_ROWS = Highlighter.getHighlightableRows();
        HIGHLIGHTABLE_ROWS.forEach((elem) => {
            elem.addEventListener('click', (event) => {
                Highlighter.highlight(event, HIGHLIGHTABLE_ROWS);
            });
        })
        ALL_ROWS.forEach((elem) => {
            ['mouseover', 'mouseout'].forEach(eventType => {
                elem.addEventListener(eventType, (event) => {
                    Highlighter.smartHover(eventType, event, this.transition);
                });
            })
        })
    }
}

        return `${queryString}${etc}`
    }
    static queryTextPreviewer(queryCell, queryRow, newRow, queryString) {
        queryCell.style.width = `${Math.floor(newRow.offsetWidth * 0.95)}px`;
        queryCell.style.fontFamily = 'Monospace';
        queryRow.style.display = '';
        queryRow.setAttribute("data-hexqueryid", newRow.dataset.hexqueryid);
        if (queryCell.firstChild && queryCell.firstChild.tagName.toLowerCase() !== 'p') {
            let preprocessedText = Previewer.preprocessQueryString(queryString);
            queryCell.insertAdjacentHTML('afterbegin', `<p><i>${preprocessedText}</i></p>`);
        }
    }
    static findQuery(datasetName, dataID, hexQueryId) {
        for (let i = 0; i < data.datasets[datasetName].length; i++) {
            if (data.datasets[datasetName][i][dataID] === hexQueryId) {
                return i
            }
        }
        return -1
    }
    static init() {
        const PARENT_ROWS = Previewer.getParentRows();
        PARENT_ROWS.forEach(parentRow => {
            let queryCell = document.createElement("td");
            queryCell.setAttribute("colspan", "100");
            let queryRow = document.createElement("tr");
            queryRow.classList.add("queryRow");
            queryRow.style.display = "none";
            let preview = JSON.parse(parentRow.closest('table').dataset["preview"])[0]
            let datasetName = preview.dataset;
            let dataID = preview.id;
            let copyQueryTextButton = Copier.drawButton();
            copyQueryTextButton.setAttribute("class", "copyQueryTextButton");
            queryCell.appendChild(copyQueryTextButton);
            queryRow.appendChild(queryCell);
            if (!parentRow.classList.contains("int1")) {
                parentRow.insertAdjacentElement("afterend", queryRow);
            }
            parentRow.addEventListener("click", event => {
                if (parentRow.classList.contains('int1')) {
                    queryRow = parentRow.nextSibling.nextSibling;
                    queryCell = queryRow.firstChild;
                }
                if (event.target.tagName.toLowerCase() !== 'a' && event.target.tagName.toLowerCase() !== 'rect') {
                    if (queryRow.style.display === 'none') {
                        let queryIndex = Previewer.findQuery(datasetName, dataID, parentRow.dataset[dataID]);
                        if (queryIndex >= 0) {
                            let queryText = data.datasets[datasetName][queryIndex].query_texts[0];
                            Previewer.queryTextPreviewer(queryCell, queryRow, parentRow, queryText);
                        }
                    } else {
                        queryRow.style.display = 'none';
                    }
                }
            })
        })
    }
}
class Copier {
    static drawButton() {
        let button = document.createElement('a');
        button.setAttribute('class', 'copyButton');
        button.setAttribute('title', 'Copy to clipboard');
        let svg = `
            <svg height="14px" width="12px" style="margin-left: 10px;">
                <rect x="2" y="2" height="12px" width="10px" rx="4" stroke="grey" fill="transparent"></rect>
                <rect x="0" y="0" height="12px" width="10px" rx="4" stroke="grey" fill="transparent"></rect>
            </svg>
        `
        button.insertAdjacentHTML('afterbegin', svg);
        return button;
    }
    static copyQueryId(ev) {
        let text = ev.target.closest('tr').dataset.queryid;
        navigator.clipboard.writeText(text).then(r => console.log('Copy: ', text));
    }
    static init() {
        document.querySelectorAll('.copyQueryId').forEach(button => {
            button.addEventListener('click', function () {
                let text = button.closest('tr').dataset.queryid;
                navigator.clipboard.writeText(text).then(r => console.log('Copy query ID'));
            })
        })
        document.querySelectorAll('.copyQueryTextButton').forEach(button => {
            button.addEventListener('click', function () {
                let hexQueryId = button.closest('tr').dataset.hexqueryid;
                data.datasets.queries.forEach(query => {
                    if (query.hexqueryid === hexQueryId) {
                        let text = query.query_texts[0];
                        navigator.clipboard.writeText(text).then(r => console.log('Copy query text'));
                    }
                })
            })
        })
        document.querySelectorAll('.copyPlanTextButton').forEach(button => {
            button.addEventListener('click', function () {
                let hexQueryId = button.closest('tr').dataset.hexqueryid;
                let hexPlanId = button.closest('tr').dataset.hexplanid;
                data.datasets.queries.forEach(query => {
                    if (query.hexqueryid === hexQueryId) {
                        query.plans.forEach(plan => {
                            if (plan.hexplanid === hexPlanId) {
                                let text = plan.plan_text;
                                navigator.clipboard.writeText(text).then(r => console.log('Copy plan text'));
                            }
                        })
                    }
                })
            })
        })
    }
}
function buildReport(data, parentNode) {
    data.sections.forEach(section => {
        let sectionHasNestedSections = ('sections' in section);
        let newSection = new BaseSection(section).init();
        if (sectionHasNestedSections) {
            buildReport(section, newSection);
        }
        parentNode.appendChild(newSection);
    })
    return parentNode;
}
function main() {
    const CONTAINER = document.getElementById('container');
    buildReport(data, CONTAINER);
    Highlighter.init();
    Previewer.init();
    Copier.init();
    Menu.init();
}
main();
</script></body></html>
